import React from 'react';
import './styles/App.css';
import MessageSender from './components/MessageSender';
import UserManager from './components/UserManager';

function App() {
  return (
    <div className="App">
      <h1>Message Sender</h1>
      <MessageSender />
      <h2>User Management</h2>
      <UserManager />
    </div>
  );
}

export default App;
